import HeaderNavbar from './HeaderNavbar';
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const NovoUsuario = () => {
  const navigate = useNavigate();

  const [nome, setNome] = useState('');
  const [sobrenome, setSobrenome] = useState('');
  const [email, setEmail] = useState('');
  const [senha, setSenha] = useState('');
  const [confirmarSenha, setConfirmarSenha] = useState('');
  const [perfil, setPerfil] = useState('');
  const [erro, setErro] = useState(null);

  const handleSalvar = () => {
    // Implemente a lógica de validação dos campos e ação de salvar aqui
    // Exemplo de validação:
    if (!nome || !sobrenome || !email || !senha || !confirmarSenha || !perfil) {
      setErro('Todos os campos são obrigatórios.');
      return;
    }
    if (email.length > 100) {
      setErro('O email deve ter no máximo 100 caracteres.');
      return;
    }
    if (senha.length < 5) {
      setErro('A senha deve ter no mínimo 5 caracteres.');
      return;
    }
    if (nome.length > 20) {
      setErro('O nome deve ter no máximo 20 caracteres.');
      return;
    }
    if (sobrenome.length > 100) {
      setErro('O sobrenome deve ter no máximo 100 caracteres.');
      return;
    }
    if (senha !== confirmarSenha) {
      setErro('As senhas não coincidem.');
      return;
    }

    // Se passar pelas validações, pode prosseguir com a ação de salvar
    // Aqui você pode implementar a lógica de salvar no banco de dados, por exemplo

    // Após salvar, redirecionar para a página de usuários
    navigate('/usuarios');
  };

  const handleCancelar = () => {
    // Ação de cancelar, redirecionando para a página de usuários
    navigate('/usuarios');
  };



  return (
    <div className="container mt-4">
      <HeaderNavbar />
      <h1>Novo Usuário</h1>
      {erro && <div className="alert alert-danger">{erro}</div>}
      <div className="mb-3">
        <label className="form-label">Nome:</label>
        <input type="text" className="form-control" value={nome} onChange={(e) => setNome(e.target.value)} />
      </div>
      <div className="mb-3">
        <label className="form-label">Sobrenome:</label>
        <input type="text" className="form-control" value={sobrenome} onChange={(e) => setSobrenome(e.target.value)} />
      </div>
      <div className="mb-3">
        <label className="form-label">Email:</label>
        <input type="email" className="form-control" value={email} onChange={(e) => setEmail(e.target.value)} />
      </div>
      <div className="mb-3">
        <label className="form-label">Senha:</label>
        <input type="password" className="form-control" value={senha} onChange={(e) => setSenha(e.target.value)} />
      </div>
      <div className="mb-3">
        <label className="form-label">Confirmar Senha:</label>
        <input type="password" className="form-control" value={confirmarSenha} onChange={(e) => setConfirmarSenha(e.target.value)} />
      </div>
      <div className="mb-3">
        <label className="form-label">Perfil:</label>
        <select className="form-select" value={perfil} onChange={(e) => setPerfil(e.target.value)}>
          <option value="">Selecione...</option>
          <option value="Admin">Admin</option>
          <option value="Dev">Dev</option>
          <option value="Padrão">Padrão</option>
        </select>
      </div>
      <div className="mb-3">
        <button type="button" className="btn btn-primary me-2" onClick={handleSalvar}>Salvar</button>
        <button type="button" className="btn btn-secondary" onClick={handleCancelar}>Cancelar</button>
      </div>
    </div>
  );
};

export default NovoUsuario;
